import "./hardskills.scss"
import 'https://flackr.github.io/scroll-timeline/dist/scroll-timeline.js';

const Hardskills = () => {

    const first = document.querySelector('#first');
    const second = document.querySelector('#second');

    const scrollTimeLine = new scrollTimeline({
        scrollOffsets: [
            new CSSUnitValue(0, 'percent'),
            new CSSUnitValue(100, 'percent'),
        ],
    });

    first.animate(
        { transform: ['translateX(50%)', 'translateX(0)'] },
        {
            timeline: scrollTimeLine,
        }
    );

    second.animate(
        { transform: ['translateX(-50%)', 'translateX(0)'] },
        {
            timeline: scrollTimeLine,
        }
    );

    return(
        <>
            <section class="page"></section>

            <section class="logo-wall" id="logoWall">
                <div class="row" id="first">
                    <img src="https://assets.codepen.io/907368/vue.svg" />
                    <img src="https://assets.codepen.io/907368/vsc.svg" />
                    <img src="https://assets.codepen.io/907368/vite.svg" />
                    <img src="https://assets.codepen.io/907368/typescript.svg" />
                    <img src="https://assets.codepen.io/907368/strapi.svg" />
                </div>
                <h3>Mein Tech Stack</h3>
                <div class="row" id="second">
                    <img src="https://assets.codepen.io/907368/sass.svg" />
                    <img src="https://assets.codepen.io/907368/nuxt.svg" />
                    <img src="https://assets.codepen.io/907368/node.svg" />
                    <img src="https://assets.codepen.io/907368/github.svg" />
                    <img src="https://assets.codepen.io/907368/angular.svg" />
                </div>
            </section>

            <section class="page"></section>
                        
        </>
    )
}

export default Hardskills
